templates.template:
export interface {{ model.name }} {

    // attributes
{% for attribute in model.attributes %}
    {{attribute.name}}: {% if attribute.type == 'integer' %}number;
{% elseif attribute.type == 'float' %}number;
{% elseif attribute.type == 'string' %}string;
{% elseif attribute.type == 'text' %}string;
{% elseif attribute.type == 'boolean' %}bool;
{% elseif attribute.type == 'date' %}Date;
{% elseif attribute.type == 'enum' %}{{attribute.enum.name | u.camel.title}};
{% endif %}
{% endfor %}

    // associations
{% for association in model.associations %}
{% if association.type == 'One-To-Many_Bidirectional' %}
    {{association.targetDomainModel.name | lower }}s:{{association.targetDomainModel.name}}s;
{% else %}
    {{association.mappedBy}}:{{association.targetDomainModel.name}};
{% endif %}
{% endfor %}
}

enum {{ enum.name }} {

    {% for option in enum.options %}
{{option.code | upper}} = "{{option.value}}",
    {% endfor %}

}

export interface {{ model.name }}Command {

{% for mapping in model.mapping %}
    {{mapping.name}}: {% if mapping.type == 'integer' %}number;
{% elseif mapping.type == 'float' %}number;
{% elseif mapping.type == 'string' %}string;
{% elseif mapping.type == 'text' %}string;
{% elseif mapping.type == 'boolean' %}bool;
{% elseif mapping.type == 'date' %}Date;
{% elseif mapping.type == 'enum' %}{{mapping.name | u.camel.title}};
{% endif %}
{% endfor %}

}

export interface {{ model.name }} {

{% for mapping in model.mapping %}
    {{mapping.name}}: {% if mapping.type == 'integer' %}number;
{% elseif mapping.type == 'float' %}number;
{% elseif mapping.type == 'string' %}string;
{% elseif mapping.type == 'text' %}string;
{% elseif mapping.type == 'boolean' %}bool;
{% elseif mapping.type == 'date' %}Date;
{% elseif mapping.type == 'enum' %}{{mapping.name | u.camel.title}};
{% else %}{{mapping.name | u.camel.title}}ReadModel;{% endif %} 
{% endfor %}

}
